export class AppComponent {
  title = 'musicPage';
}
<mat-toolbar color="primary">
  <mat-icon>local_fire_department</mat-icon>
  <span>DavidAC</span>
</mat-toolbar>

<iframe
  style="border-radius: 12px;"
  src="https://open.spotify.com/embed/playlist/4kDeVmGjtYWsaq2VYsQBSX?utm_source=generator&theme=0"
  width="100%"
  height="352"
  frameborder="0"
  allowfullscreen=""
  allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture"
  loading="lazy"
></iframe>
